import React from "react";
import faviconImage from '../assets/favicon-image.png'
import "./../styles/Navbar.css";

function Navbar() {
  return (
    <nav className="navbar">
        <div class="navbar_logo">
            <img src={faviconImage} className="favicon-img" />
            <a href="https://theajouglobe.ajou.ac.kr/home">아주대학교 영자신문사</a>
        </div>
        <ul class="navbar-links">
            <li><a href="https://theajouglobe.ajou.ac.kr/home">Home</a></li>
            <li><a href="http://theajouglobe.kr/">Articles</a></li>
            <li><a href="https://ajouglobe1989.wixsite.com/press/blog">Previous Website (~No.166)</a></li>
            <li><a href="https://www.instagram.com/theajouglobe" id="instagram"><i class="fa-brands fa-instagram"></i></a></li>
        </ul>
    </nav>
  );
}

export default Navbar;
